import React from "react";
import '../Styles/Account.css';

function Account() {
    return(
        <div id='accBody'>
            <h1 id='welcomeMsg'>Welcome back, Firstname Lastname.</h1>

            <div id='checkingsBox'>
                <h1 className="accTitle">Checkings</h1>
            </div>

        </div>
    )
}

export default Account;
